import React, { useEffect, useState } from 'react';
import classes from './Main.module.css';
import Button from '../../components/UI/Button/Button';
import DinamicCounter from '../../components/UI/DinamicCounter/DinamicCounter';

export default function Main() {
  // useEffect(() => {
  //   document.title = 'Avant-Техно | Главная';
  // });
  const [state, setState] = useState(0);
  return (
    <main className={classes.main__container}>
        {/* <div>
          <h3>Главная страница</h3>
          <Button text= {"+"} onClick={() => {setState(state+1)}}/>
          <h1>{state}</h1>
          <Button text={"-"} onClick={() => {setState(state-1)}}/>
        </div> */}
        <DinamicCounter number={555}/>
        <svg>
          <line x1="100" y1="5" x2="5" y2="100" stroke="#765373" strokeWidth="3"/>
          <line x1="80" y1="5" x2="5" y2="80" stroke="#765373" strokeWidth="3"/>
          <line x1="100" y1="25" x2="25" y2="100" stroke="#765373" strokeWidth="3"/>
          <line x1="60" y1="5" x2="5" y2="60" stroke="#765373" strokeWidth="3"/>
          <line x1="100" y1="45" x2="45" y2="100" stroke="#765373" strokeWidth="3"/>
          <line x1="40" y1="5" x2="5" y2="40" stroke="#765373" strokeWidth="3"/>
          <line x1="100" y1="65" x2="65" y2="100" stroke="#765373" strokeWidth="3"/>
          <line x1="20" y1="5" x2="5" y2="20" stroke="#765373" strokeWidth="3"/>
          <line x1="100" y1="85" x2="85" y2="100" stroke="#765373" strokeWidth="3"/>
          <line x1="5" y1="5" x2="100" y2="100" stroke="#765373" strokeWidth="3"/>
          <line x1="25" y1="5" x2="100" y2="80" stroke="#765373" strokeWidth="3"/>
          <line x1="5" y1="25" x2="100" y2="100" stroke="#765373" strokeWidth="3"/>
        </svg>
    </main>
  );
}
